import React from 'react'



function Bfs({ cols, rows }) {
    function Node(x, y) {
        this.x = x;
        this.y = y;
    };

    const createGrid = () => {
        for (let i = 0; i < rows; i++) {
            grid[i] = new Array()
            for (let j = 0; j < cols; j++) {
                grid[i][j] = new Node(i, j)
            }
        }

        return grid
    }

    const findNeighbors = (grid, cord) => {
        let neighbors = [];

        //Nahoru
        if (cord[0] + 1 < grid.length) {
            neighbors.push([cord[0] + 1, cord[1]])
        }

        //Dolu
